      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 69 - - + col1 + col0 * - col2 BETWEEN - col1 AND - col2 * + 71 / - 69 + ( 28 ) + + - col1;
  - name: tab1

outputs:
  - name: q6030.out
    data: |
      51	14	96
      85	5	59
      91	47	68
